import React from "react";

function GoAuthenticatePage() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>You are not authenticated. Please log in to view this page</h1>
      <span>
        Don't have an account? <Link to="/register">Join us!</Link>
      </span>
    </div>
  );
}

export default GoAuthenticatePage;
